const baseUrl = 'http://localhost:3000'
const vue = new Vue({
  el: '#app',
  data: {
    page: '',
    input: {
      name: '',
      workExp: '',
      academic: '',
      skill: '',
      project: '',
      hobbies: '',
      email: '',
    },
    loginForm: {
      email: '',
      password: ''
    },
    registerForm: {
      firstName: '',
      lastName: '',
      email: '',
      password: ''
    },
    regisForm : {
      firstName : '',
      lastName : '',
      email : '',
      password : ''
    },
    file: '',
    isLogin: false,
    isLoading: false,
    finishUpload: false,
    myCVs: []
  },
  methods: {
    generateCV() {
      this.finishUpload = false
      let formData = new FormData()
      formData.append('image', this.file)
      formData.append('fullName', this.input.name)
      formData.append('workExp', this.input.workExp)
      formData.append('academic', this.input.academic)
      formData.append('skill', this.input.skill)
      formData.append('project', this.input.project)
      formData.append('hobby', this.input.hobbies)
      formData.append('email', this.input.email)
      // console.
      axios({
        method: 'post',
        url: 'http://localhost:3000/upload',
        data: formData,
        headers: {
          token: localStorage.token
        }
      })
        .then(({ data }) => {
          swal('CV Created!', 'Â ', 'success')
          this.getMyCVs()
          console.log({ data })
        })
        .catch(err => {
          console.log({ err })
        })
    },
    genPDF(input) {
      const doc = new jsPDF()
      let imgData = 'data:image/png;base64,'
      doc.addImage(imgData, 'JPEG', 0, 0, 210, 297)
      doc.addImage(input, 'JPEG', 10, 60, 65, 90)
      doc.setFontSize(25)
      doc.text(90, 40, this.input.workExp)
      doc.text(90, 95, this.input.academic)
      doc.text(90, 157, this.input.skill)
      doc.text(90, 215, this.input.project)
      doc.text(90, 270, this.input.hobbies)
      doc.setTextColor('#FFFFFF')
      doc.text(10, 225, this.input.email)
      doc.text(7, 165, this.input.name)
      this.file = doc.output('blob')
      this.isLoading = false
      this.finishUpload = true
      console.log({ file: this.file })
    },
    registerUser(){
      axios({
        method: 'post',
        url : `${baseUrl}/register`,
        data : {
          firstName : this.regisForm.firstName,
          lastName : this.regisForm.lastName,
          email : this.regisForm.email,
          password : this.regisForm.password
        }
      })
      .then(response =>{
        Swal.fire({
          position: 'center',
          type: 'success',
          title: 'Register succesfully',
          showConfirmButton: false,
          timer: 1500
        })
      })
      .catch(err =>{
        Swal.fire({
          type: 'error',
          title: 'Oops...',
          text: 'Email has been used!',
          footer: 'Change your email address!'
        })
      })
    },
    loginUser(input) {
      // console.log(input);
      this.page = 'login'
      axios.post(baseUrl + '/login', {
        email: input.email,
        password: input.password
      })
        .then(({ data }) => {
          this.successLogin(data)
        })
        .catch(err => {
          swal(err.message)
          console.log({err})
        })
    },
    register() {
      console.log(this.registerForm)
      let { name, email, password } = this.registerForm
      name = `${this.registerForm.firstName} ${this.registerForm.lastName}`
      console.log({name})
      axios.post(baseUrl + '/register', { name, email, password })
        .then(({ data }) => {
          // this.successLogin(data)
          this.registerForm = {
            firstName: '',
            lastName: '',
            email: '',
            password: ''
          }
          swal('Registered!', 'ðŸ‘‹ðŸ»', 'success')
        })
        .catch(err => {
          console.log({ err })
          swal(err.message)
        })
    },
    emptyLocalStorage() {
      console.log('masuk empty')
      window.localStorage.removeItem('token')
      window.localStorage.removeItem('id')
      window.localStorage.removeItem('email')
      swal('Signed out', `Goodbye, ${localStorage.name}!`, 'success')
      window.localStorage.removeItem('name')
      this.isLoggedIn = false
      this.page = 'login'
      this.checkLog()
    },
    logout() {
      this.loginEmail = ''
      this.loginPassword = ''
      this.username = ''
      if (gapi.auth2 != undefined) {
        var auth2 = gapi.auth2.getAuthInstance()
        auth2.signOut()
          .then(() => {
            this.emptyLocalStorage()
            this.checkLog()
          })
          .catch(err => {
            console.log({ err })
          })
      }
      else {
        this.emptyLocalStorage()
        this.checkLog()
      }
    },
    checkLog() {
      if (localStorage.token != undefined) {
        this.page = 'home'
        this.getMyCVs()
      } else {
        this.page = 'register'
      }
    },
    successLogin(data) {
      window.localStorage.setItem('token', data.token);
      window.localStorage.setItem('name', data.name);
      window.localStorage.setItem('email', data.email);
      window.localStorage.setItem('id', data.id);
      this.loginUser = {
        email: '',
        name: '',
        password: ''
      };
      this.isLoggedIn = true;
      swal(`Selamat datang ${data.name}!`, ' ', 'success');
      this.checkLog();
    },
    getMyCVs() {
      axios({
        method: 'get',
        url: 'http://localhost:3000/myCVs',
        headers: {
          token: localStorage.token
        }
      })
        .then(({data}) => {
          console.log({data})
          data.map(item => {
            item.fbUrl = 'http://www.facebook.com/sharer.php?u='+ item.url
          })
          console.log({data, dari: 'ucup'})
          this.myCVs = data
        })
        .catch(err => {
          console.log({err})
          swal(err.message)
        })
    }
    // test() {
    //   this.page = 'register'
    // }
  },
  created() {
    if (localStorage.token) {
      console.log('ada local')
      this.isLogin = true
    } else if (!localStorage.token) {
      this.page = 'home'
      this.isLogin = false
    }
    this.checkLog()
  }
})


function encodeImageFileAsURL(element) {
  this.isLoading = true
  var file = element.files[0];
  vue.file = event.target.files[0];
  var reader = new FileReader();
  reader.onloadend = function () {
    vue.genPDF(reader.result)
  }
  reader.readAsDataURL(file);
}

